import React from "react";

let firstName = "Bob";
let lastName = "Seiger";
// Content component
const Content = (firstName, lastName) => (
  <div>
    <main>Content</main>
    <p>Hello, {firstName + " " + lastName}</p>
  </div>
);

export default Content;
